import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
    return (
        <>
            <NavLink exact to="./" >Home</NavLink>
            <NavLink exact to="./About" >About</NavLink>
            <NavLink exact to="./" >Home</NavLink>

        </>
    )
}

export default Navbar;
